import React from "react";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import './App.css';
import HomePage from "./components/HomePage/HomePage";
import AboutUs from "./components/AboutUs/AboutUs";
import ContactUs from "./components/ContactUs/ContactUs";
import Login from "./components/Login/Login";
import BusinessListingsPage from "./components/BusinessListingsPage/BusinessListingsPage"
import BusinessPage from "./components/BusinessPage/BusinessPage"

const PageHeaderRender = () => {
    return (
        <div className={"App"}>
            <Router>
                <Switch>
                    <Route path="/AboutUs" component={AboutUs}>
                        <AboutUs />
                    </Route>
                    <Route path="/GetBusinesses" component={BusinessPage}>
                        <BusinessListingsPage searchTerm={""}/>
                    </Route>
                    <Route path="/ShowBusiness" component={BusinessListingsPage}>
                        <BusinessPage />
                    </Route>
                    <Route path="/ContactUs" component={ContactUs}>
                        <ContactUs />
                    </Route>
                    <Route path="/Login" component={Login}>
                        <Login />
                    </Route>
                    <Route path="/" component={HomePage}>
                        <HomePage />
                    </Route>
                </Switch>
            </Router>
        </div>
    )
}

export default PageHeaderRender;
